import React from 'react';
import { Link } from 'react-router-dom';


function Home() {
    return (
        <div>
            <div className='header'>
                <h1>Добро пожаловать на сайт Пушистые Путешествия</h1>
                <Link to="/login">
                    <button> Вход </button>
                </Link>
                <Link to="/registration">
                    <button>Регистрация </button>
                </Link>
            </div>
        </div>
    );
}

export default Home;
